import gql from 'graphql-tag';

//Query para el discograf

export const songs_query = gql `{
    getSongs {
        id
        songname
        artname
        album
    }
}`

export const song_query = gql `
    query Song($track: ID!){
        getSong(id: $track){
            source
            id
            songname
        }
    }
`;
